import React from "react";
import styles from "../CSS/component.module.css";

export const UserDetailEstimator = () => {
  return (
    <div className={styles.row_container}>
      <p>파일ID</p>
      <p>태스크이름</p>
      <p>총튜플수</p>
      <p>중복튜플수</p>
      <p>NULL RATIO</p>
      <button className={styles.row_button}>다운로드</button>
      <p>부여점수</p>
    </div>
  );
};
